CREATE TABLE `co_cotizacion_sub` (
  `ccotizacion` int(10) unsigned zerofill NOT NULL AUTO_INCREMENT,
  `correlativo` int(10) unsigned zerofill NOT NULL,
  `corigen` int(10) unsigned zerofill NOT NULL,
  `ctipo` int(10) unsigned zerofill NOT NULL,
  `clugar` int(10) unsigned zerofill NOT NULL,
  `cvehiculo` int(10) unsigned zerofill NOT NULL,
  `dist` decimal(10,2) NOT NULL,
  `viajes` int(2) NOT NULL,
  `tipo` int(1) NOT NULL,
  `cequipo` int(10) unsigned zerofill NOT NULL,
  `status` varchar(3) COLLATE utf8_bin NOT NULL DEFAULT 'PEN',
  `m_serv` decimal(12,2) NOT NULL DEFAULT '0.00',
  `m_rep` decimal(12,2) NOT NULL DEFAULT '0.00',
  `m_ins` decimal(12,2) NOT NULL DEFAULT '0.00',
  `m_stt` decimal(12,2) NOT NULL DEFAULT '0.00',
  `m_tra` decimal(12,2) NOT NULL DEFAULT '0.00',
  `m_misc` decimal(12,2) NOT NULL DEFAULT '0.00',
  `m_subt` decimal(12,2) NOT NULL DEFAULT '0.00',
  `m_descp` decimal(5,2) NOT NULL DEFAULT '0.00',
  `m_desc` decimal(12,2) NOT NULL DEFAULT '0.00',
  `m_neto` decimal(12,2) NOT NULL DEFAULT '0.00',
  `m_impp` decimal(5,2) NOT NULL DEFAULT '0.00',
  `m_imp` decimal(12,2) NOT NULL DEFAULT '0.00',
  `m_bruto` decimal(12,2) NOT NULL DEFAULT '0.00',
  `hh_taller` decimal(12,2) NOT NULL DEFAULT '0.00',
  `hh_terreno` decimal(12,2) NOT NULL DEFAULT '0.00',
  `trabs` int(1) NOT NULL DEFAULT '0',
  `valor_dia` decimal(12,2) NOT NULL DEFAULT '0.00',
  `valor_misc` decimal(12,2) NOT NULL DEFAULT '0.00',
  `pag_gasto` decimal(12,2) NOT NULL DEFAULT '0.00',
  `pag_marg` decimal(12,2) NOT NULL DEFAULT '0.00',
  `mar_ins` decimal(12,2) NOT NULL DEFAULT '0.00',
  `mar_rep` decimal(12,2) NOT NULL DEFAULT '0.00',
  `mar_stt` decimal(12,2) NOT NULL DEFAULT '0.00',
  `sal` decimal(12,2) NOT NULL DEFAULT '0.00',
  `costo_km` decimal(12,2) NOT NULL DEFAULT '0.00',
  `cordenservicio_sub` int(10) unsigned zerofill DEFAULT NULL,
  `cfactura` int(10) unsigned DEFAULT NULL,
  `fecha_fac` date DEFAULT NULL,
  `notas` text COLLATE utf8_bin,
  `notas_user` text COLLATE utf8_bin,
  `archivo` varchar(100) COLLATE utf8_bin DEFAULT NULL,
  `corigen_gar` int(10) unsigned zerofill NOT NULL DEFAULT '0000000000',
  `crea_user` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `crea_date` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `mod_user` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `mod_date` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`ccotizacion`),
  UNIQUE KEY `uk_cordenservicio_sub` (`cordenservicio_sub`,`corigen`) USING BTREE,
  KEY `ccotizapadre` (`corigen`),
  KEY `ctipo` (`ctipo`),
  KEY `clugar` (`clugar`),
  KEY `cvehiculo` (`cvehiculo`),
  KEY `cequipo` (`cequipo`),
  KEY `corigen_gar` (`corigen_gar`),
  CONSTRAINT `fk_ccotizapadre_co_cotizacion` FOREIGN KEY (`corigen`) REFERENCES `co_cotizacion` (`ccotizacion`),
  CONSTRAINT `fk_cequipo_co_cotizacion` FOREIGN KEY (`cequipo`) REFERENCES `par_eq_trabajo` (`cequipo`),
  CONSTRAINT `fk_clugar_co_cotizacion` FOREIGN KEY (`clugar`) REFERENCES `par_lugar` (`clugar`),
  CONSTRAINT `fk_ctipo_co_cotizacion` FOREIGN KEY (`ctipo`) REFERENCES `co_tipos` (`ctipo`),
  CONSTRAINT `fk_cvehiculo_co_cotizacion` FOREIGN KEY (`cvehiculo`) REFERENCES `par_vehiculos` (`cvehiculo`)
