/*!50003 CREATE*/ /*!50017 DEFINER=`metalsigmauser`@`localhost`*/ /*!50003 TRIGGER `set_mod_co_cotizacion_sub` BEFORE UPDATE ON `co_cotizacion_sub` FOR EACH ROW
BEGIN
  DECLARE _result INT;
  DECLARE _op INT;
  SET _result = (SELECT COALESCE(MAX(cordenservicio) + 1,1) FROM co_cotizacion);
  SET _op = (SELECT cordenservicio FROM co_cotizacion WHERE ccotizacion=NEW.corigen);

  IF (NEW.cordenservicio_sub=1 && NEW.status="APB") THEN
    SET NEW.cordenservicio_sub = LAST_INSERT_ID((SELECT COALESCE(MAX(cordenservicio_sub) + 1,1) FROM co_cotizacion_sub WHERE corigen = NEW.corigen));
    SET NEW.status="PRO";
    IF _op <= 0 THEN
      UPDATE co_cotizacion SET cordenservicio = _result, mod_user=NEW.mod_user, mod_date=NEW.mod_date WHERE ccotizacion=NEW.corigen;
    END IF;    
  END IF;
  IF (NEW.cfactura>0 && NEW.status="PRO") THEN
    SET NEW.status="FAC";
  END IF;
  IF (NEW.mod_user IS NULL || NEW.mod_user='') THEN
    SET NEW.mod_user = UPPER(SUBSTR(USER(), 1,(LOCATE('@', USER())-1)));
  END IF;
  IF (NEW.status="APB") THEN
    UPDATE com_cot_ser SET status = "UTI" WHERE cods = OLD.ccotizacion;
  ELSEIF (NEW.status="CAN") THEN
    UPDATE com_cot_ser SET status = "CAN" WHERE cods = OLD.ccotizacion;
  END IF;
END */;;
DELIMITER ;
