/*!50003 CREATE*/ /*!50017 DEFINER=`metalsigmauser`@`localhost`*/ /*!50003 TRIGGER `history_update_cotizacion_sub` AFTER UPDATE ON `co_cotizacion_sub` FOR EACH ROW BEGIN
	DECLARE user_name VARCHAR(50);
    DECLARE _bool INT(1);
    IF (NEW.mod_user IS NULL || NEW.mod_user='') THEN
        SET user_name = UPPER(SUBSTR(USER(), 1,(LOCATE('@', USER())-1)));
    ELSE
    	SET user_name = NEW.mod_user;
    END IF;
	IF NEW.mod_date != OLD.mod_date THEN
    	IF (OLD.ctipo!=NEW.ctipo) || (OLD.clugar!=NEW.clugar) || (OLD.cvehiculo!=NEW.cvehiculo) || (OLD.dist!=NEW.dist) || (OLD.viajes!=NEW.viajes) || (OLD.tipo!=NEW.tipo) || (OLD.cequipo!=NEW.cequipo) || (OLD.m_serv!=NEW.m_serv) || (OLD.m_rep!=NEW.m_rep) || (OLD.m_ins!=NEW.m_ins) || (OLD.m_stt!=NEW.m_stt) || (OLD.m_tra!=NEW.m_tra) || (OLD.m_misc!=NEW.m_misc) || (OLD.m_subt!=NEW.m_subt) || (OLD.m_descp!=NEW.m_descp) || (OLD.m_desc!=NEW.m_desc) || (OLD.m_neto!=NEW.m_neto) || (OLD.m_impp!=NEW.m_impp) || (OLD.m_imp!=NEW.m_imp) || (OLD.m_bruto!=NEW.m_bruto) THEN
        	INSERT INTO hist_cotizacion_sub (ccotizacion,corigen,ctipo,clugar,cvehiculo,dist,viajes,tipo,cequipo,m_serv,m_rep,m_ins,m_stt,m_tra,m_misc,m_subt,m_descp,m_desc,m_neto,m_impp,m_imp,m_bruto,acc,user) VALUES (OLD.ccotizacion,OLD.corigen,OLD.ctipo,OLD.clugar,OLD.cvehiculo,OLD.dist,OLD.viajes,OLD.tipo,OLD.cequipo,OLD.m_serv,OLD.m_rep,OLD.m_ins,OLD.m_stt,OLD.m_tra,OLD.m_misc,OLD.m_subt,OLD.m_descp,OLD.m_desc,OLD.m_neto,OLD.m_impp,OLD.m_imp,OLD.m_bruto,1,user_name);              	
        END IF;
    END IF;
END */;;
DELIMITER ;
