/*!50003 CREATE*/ /*!50017 DEFINER=`metalsigmauser`@`localhost`*/ /*!50003 TRIGGER `set_status_odc` AFTER UPDATE ON `com_odc_det` FOR EACH ROW BEGIN
	DECLARE cant_restante INT(10);
    SELECT SUM(cant_rest) INTO cant_restante FROM com_odc_det WHERE corden=NEW.corden;
    IF cant_restante <=0 THEN
    	UPDATE com_odc SET status="UTI", mod_user=NEW.mod_user WHERE corden = NEW.corden;
    ELSEIF cant_restante > 0 THEN
    	UPDATE com_odc SET status="PRO", mod_user=NEW.mod_user WHERE corden = NEW.corden;
    END IF;
END */;;
