INSERT INTO `inv_articulos` VALUES (0000000001,'000','','COMB REPAIR TIME (WRNT)','ONLY USAGE IS FOR WARRANTY ON-HWY TRUCK CLAIMS (TRGS). THIS CODE IS USED FOR COMBINED REPAIR TIMES. COMBINED REPAIR CODING IS RESERVED FOR WARRANTY CLAIMING ACTIVITIES ONLY.',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000002,'001','','REPAIR FOR WARRANTY','TO RESTORE TO THE OPERATING CONDITION EXISTING BEFORE THE WARRANTABLE FAILURE. INTENDED FOR WARRANTY SERVICE LETTER USAGE ONLY.',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000003,'002','','TFR COMPONENTS TO/FROM','THIS CODE IS USED WHEN TRANSFERRING NECESSARY REUSABLE PARTS FROM ONE ASSEMBLED COMPONENT TO ANOTHER UP TO AND INCLUDING COMPLETE ENGINES.',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000004,'003','','REMV, REPR F/WTY, INSTL','COMBINATION OF REMOVAL, REPAIR UNDER WARRANTY AND REINSTALLATION.',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000005,'004','','WIRE TO/FROM','TO CONNECT AND/OR DISCONNECT WIRES OR WIRING HARNESS FROM ONE OR MORE TERMINALS TO OTHER TERMINALS.',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000006,'005','','SALVAGE','BRINGING A COMPONENT BACK TO SOUND WORKING CONDITION AS AN ALTERNATIVE TO REPLACING THE COMPONENT. INCLUDES OPERATIONS SUCH AS MACHINING, GRINDING, MILLING, FILING, WELDING AND CUTTING. TO RESTORE A WORN OR DAMAGED PART TO FUNCTIONAL SPECIFICATIONS BY WELDING, CHROME PLATING, METALIZING, OR BY USE O',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000007,'006','','PROGR AS RECONDITION','TO REBUILD OR RESTORE TO LIKE NEW CONDITION REUSING PARTS ACCORDING TO PARTS REUSABILITY GUIDELINES WITH ASSEMBLY PERFORMED BY MOVING THE UNIT THROUGH SUCCESSIVE ASSEMBLY STATIONS.',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000008,'007','','RECONDITION AFTER FAILURE','USED FOR CALCULATOR APPLICATION. TO REBUILD OR RESTORE AN INOPERABLE COMPONENT TO LIKE NEW CONDITION AFTER THE COMPONENT HAS FAILED OR BEEN DAMAGED. FOR QUOTING PURPOSES ONLY. USE 511-REPLACE WITH NEW INSTEAD.',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000009,'008','','TAKE & ANALYZE S-O-S FROM','TAKING AND ANALYZING A SCHEDULED OIL SAMPLE. PROCURE AN OIL SAMPLE FROM A COMPONENT AND PERFORM OIL LAB ANALYSIS.',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000010,'009','','LIFT, BLOCK & LOWER','TO RAISE A PRODUCT, SUPPORT IT WITH JACK STANDS OR OTHER SUPPORTS, AND LET IT DOWN.',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000011,'010','','REMOVE & INSTALL','THE REMOVAL OF A COMPONENT FOLLOWED BY A SUBSEQUENT REINSTALLATION OF THE COMPONENT.  INCLUDES REMOVING, DISCONNECTING, REINSTALLING, CONNECTING, ADJUSTING AND OTHER ACTIVITIES WHICH ARE CONSIDERED A NORMAL PART OF THE JOB.',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000012,'011','','REMOVE','TAKING OFF A PART OR COMPONENT. USE 010-REMOVE & INSTALL',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000013,'012','','INSTALL','ATTACH, OR SET INTO POSITION AND PREPARE FOR USE. TO PLACE IN POSITION AND TIGHTEN BOLTS, CLAMPS, FITTINGS, HOSES, ETC.  INCLUDES NORMAL TORQUE MEASUREMENTS AND ADJUSTMENTS. USE 010-REMOVE & INSTALL',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000014,'013','','REPLACE WITH DLR EXCHNGE','REMOVING PART OR COMPONENT AND INSTALLING A DEALER EXCHANGE PART OR COMPONENT IN ITS PLACE. REMOVE EXISTING COMPONENT AND INSTALL A DEALER EXCHANGE COMPONENT.  DEALER EXCHANGE WOULD CONSIST OF COMPONENTS REBUILT BY THE DEALER OR PROCURED FROM SOME SOURCE OTHER THAN CATERPILLAR.',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000015,'014','','REPLACE GASKET / SEAL','REMOVING EXISTING GASKET(S) OR SEAL(S) AND INSTALL NEW GASKET(S) OR SEAL(S). TYPICALLY WOULD USE THIS CODE FOR RESEALING CYLINDERS. ANOTHER EXAMPLE IS USED FOR REPAIRING A LEAKING VALVE COVER GASKET.',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000016,'015','','DISASSEMBLE','DISASSEMBLE OR TAKE APART. TO TAKE APART OR TEAR DOWN (INCLUDING CRITICAL INSPECTION OF PARTS). USE 017-DISASSEMBLE & ASSEMBLE',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000017,'016','','ASSEMBLE','ASSEMBLE OR FITTING TOGETHER. TO PUT OR JOIN (INCLUDING NORMAL TORQUE MEASUREMENTS AND ADJUSTMENTS). USE 017-DISASSEMBLE & ASSEMBLE',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000018,'017','','DISASSEMBLE & ASSEMBLE','DISASSEMBLE OR TAKE APART AND ASSEMBLE AND FIT TOGETHER. A COMBINATION OF DISASSEMBLY AND ASSEMBLY.  A JOB OPERATION GENERALLY USED IN RECONDITIONING WORK. DOES NOT INCLUDE THE REMOVAL AND INSTALLATION OF COMPONENT FROM THE MACHINE.',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000019,'018','','PIN & BUSHING TURN','REMOVAL, ROTATION AND INSTALLATION OF TRACK PINS AND BUSHINGS.  ROTATION TO EXPOSE A NEW WEAR SURFACE.',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000020,'019','','RECONDITN BEFORE FAILURE','USED FOR CALCULATOR APPLICATION. TO REBUILD OR RESTORE AN OPERABLE COMPONENT TO LIKE NEW OPERATING CONDITION, AND THE COMPONENT REPAIR CAN BE BASED ON A \"PLANNED\" INTERVAL. FOR QUOTING PURPOSES ONLY.',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000021,'020','','RECONDITION','TO REBUILD OR RESTORE AN OPERABLE COMPONENT TO LIKE NEW OPERATING CONDITION.  USE THIS JOB CODE WHEN \"BEFORE\" OR \"AFTER\" FAILURE IS NOT REQUIRED TO DEFINE THE JOB. USE AT SINGULAR PART LEVEL, NOT AT AN ASSEMBLY OR GROUP LEVEL.',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000022,'021','','RECONDITION FOR EXCHANGE','TO REBUILD OR RESTORE TO LIKE NEW OPERATING CONDITION FOR DEALER EXCHANGE.',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000023,'022','','REMV RECONDITION & INSTL','THE REMOVAL OF AN OPERABLE COMPONENT FOLLOWED BY THE REBUILDING OR RESTORING OF THAT COMPONENT TO LIKE NEW OPERATING CONDITION, AND SUBSEQUENT REINSTALLATION OF THE SAME COMPONENT.  USE WHEN NO PLANNED INTERVAL IS DEFINABLE OR APPROPRIATE.',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000024,'023','','REPAIR','TO RESTORE TO OPERATING CONDITION. USE WHEN THERE IS NO SPECIFIC JOB CODE THAT DEFINES THE SPECIFIC WORK BEING PERFORMED.',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000025,'024','','ALIGN','PUTTING AN ENGINE, GENERATOR, TRANSMISSION, OR COMPONENT INTO THE CORRECT OR APPROPRIATE RELATIVE POSITIONS. OFTEN ASSOCIATED WITH GENERATORS AND MARINE ENGINES. TO RESTORE AN ESTABLISHED LINEAR OR ANGULAR RELATIONSHIP.',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000026,'025','','ADJUST','MOVING PARTS OF A COMPONENT OR PRODUCT TO ACHIEVE THE CORRECT ORIENTATION, MEASUREMENT, OR ADJUSTMENT. ANY STATIC OR DYNAMIC ADJUSTMENTS MADE INDEPENDENTLY OF ANY OTHER ACTIVITY.',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000027,'026','','RECONDITION IN FRAME','TO REBUILD OR RESTORE A COMPONENT TO LIKE NEW CONDITION WITHOUT REMOVING THE ASSOCIATED MAJOR COMPONENT FROM THE PRIMARY MACHINE OR VEHICLE.',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000028,'027','','ORIGINAL INSTALLATION','TO PLACE IN POSITION FOR THE FIRST TIME, INCLUDING PRODUCT MODIFICATIONS REQUIRED TO COMPLETE PLACEMENT.',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000029,'028','','REPLACE BEARINGS & SEALS','REMOVE EXISTING BEARING/BUSHING, AND INSTALL NEW BEARING/BUSHING AND SEALS IF NEEDED.',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000030,'029','','SEPARATE & CONNECT','DIVIDING CONSTITUENT OR DISTINCT PARTS OR COMPONENTS AND BRINGING TOGETHER SUCH AS CONNECTING THE GENERATOR TO THE ENGINE. TO PULL APART TWO OR MORE COMPONENTS FOLLOWED LATER BY RE-CONNECTING OF SAME COMPONENTS.',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000031,'030','','TEST AFTER REPAIR','TESTING A MACHINE, ENGINE, OR COMPONENT AFTER REPAIR COMPLETION TO VALIDATE CORRECT OPERATION AND REPAIR ACCURACY. CHECKING OF COMPONENT AFTER REPAIR TO DETERMINE ACCEPTABLE OPERATION OF THE PRIMARY MACHINE OR VEHICLE.',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000032,'031','','DYNAMOMETER TEST','OPERATING AN ARTIFICIALLY LOADED AN ENGINE TO EVALUATE RATING AND FUNCTION UTILIZING A DYNAMOMETER. CHECKING ACCEPTABLE OPERATION USING A DYNAMOMETER.',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000033,'032','','HYDRAULIC TEST','PERFORMANCE MEASUREMENT OF ANY HYDRAULIC COMPONENT OR SYSTEM.',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000034,'033','','LOAD BANK TEST','ARTIFICIALLY LOADING A GENERATOR AND BRINGING THE ENGINE TO OPERATING TEMPERATURE, VALIDATING FUNCTIONALITY. PERFORMANCE MEASUREMENT OF A POWER GENERATING SYSTEM.',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000035,'034','','CRACK/LEAK TEST','PROCESS OF USING MECHANICAL OR CHEMICAL MEANS TO IDENTIFY STRUCTURAL PART(S) DEFECTS OR IMPROPER SEAL.',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000036,'035','','TROUBLESHOOT','LOCATE THE ROOT CAUSE OF THE FAILURE OR COMPLAINT. TO DETERMINE EXTENT AND CAUSE OF MALFUNCTION OR PROBLEM.',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04-25 17:18:46'),(0000000037,'036','','TEST/CHECK & ADJUST','USE OF TEST INSTRUMENTS ON A COMPONENT, VISUAL CHECK & INSPECTION, AND PERFORMING ADJUSTMENTS AS NEEDED.',0000000004,0.00,0.00,0.00,0000000000,0,0.00,1,'METALSIGMAUSER','2019-02-27 11:09:06','METALSIGMAUSER','2019-04