/*!50003 CREATE*/ /*!50017 DEFINER=`metalsigmauser`@`localhost`*/ /*!50003 TRIGGER `set_crea_inv_movimientos_det` BEFORE INSERT ON `inv_movimientos_det` FOR EACH ROW BEGIN
  DECLARE _tipo VARCHAR(3);
    DECLARE _cot INT(10);
    DECLARE _alm INT(10);
    DECLARE _cant DECIMAL(10,2);
    SELECT tipo,corigen,calmacen INTO _tipo,_cot,_alm FROM inv_movimientos WHERE cmovimiento_key=NEW.cmovimiento_key AND tipo="CSM";
    SELECT cant INTO _cant FROM inv_reservas WHERE status=1 AND ccotizacion=_cot AND calmacen=_alm AND carticulo = NEW.carticulo;
  IF (NEW.crea_user IS NULL || NEW.crea_user='') THEN
      SET NEW.crea_user = UPPER(SUBSTR(USER(), 1,(LOCATE('@', USER())-1)));
    END IF;
    IF (_tipo="CSM") THEN
      -- EL MOVIMIENTO ES UN CONSUMO PROCEDO A BUSCAR LA RESERVA
        IF _cant > 0 THEN
          -- HAY UNA RESERVA
            UPDATE inv_reservas SET status=0, mod_user = NEW.crea_user WHERE status=1 AND ccotizacion=_cot AND calmacen=_alm AND carticulo = NEW.carticulo;
            IF ( (_cant-NEW.cant)>0 ) THEN
              INSERT INTO inv_reservas (ccotizacion,calmacen,carticulo,cant,notas,status,crea_user) VALUES (_cot,_alm,NEW.carticulo,(_cant-NEW.cant),"CONSUMO DE RESERVA POR ODS",1,NEW.crea_user);
            END IF;
        END IF;
    END IF;
END */;;
DELIMITER ;
