/*!50003 CREATE*/ /*!50017 DEFINER=`metalsigmauser`@`localhost`*/ /*!50003 TRIGGER `set_cant_ins` AFTER INSERT ON `inv_movimientos_det` FOR EACH ROW BEGIN
    DECLARE done INT DEFAULT FALSE;
    DECLARE articulo INT;
    DECLARE cant DECIMAL(15,2);
    DECLARE costo DECIMAL(15,2);
    DECLARE cur CURSOR FOR SELECT SUM(CASE WHEN ((im.tipo="NTE" && im.corigen=0) || im.tipo="COM" || im.tipo="AJE" || im.tipo="SI" || im.tipo="DCS" || im.tipo="DCI") THEN imd.cant WHEN (im.tipo="DNT" || im.tipo="DCO" || im.tipo="AJS" || im.tipo="CSM" || im.tipo="COI") THEN imd.cant*-1 ELSE 0 END) AS cant_real, IFNULL(ac.costo,0) as costo, ia.carticulo FROM inv_articulos ia LEFT JOIN inv_movimientos_det imd ON ia.carticulo=imd.carticulo LEFT JOIN inv_movimientos im ON imd.cmovimiento_key=im.cmovimiento_key AND im.status = "PRO" LEFT JOIN (SELECT ia.carticulo, MAX(im.fecha_mov) AS fecha, imd.costou AS costo FROM inv_articulos ia LEFT JOIN inv_movimientos_det imd ON ia.carticulo=imd.carticulo LEFT JOIN inv_movimientos im ON imd.cmovimiento_key=im.cmovimiento_key AND im.status = "PRO" WHERE ((im.tipo="NTE" && im.corigen=0) || im.tipo="COM" || im.tipo="SI") GROUP BY ia.carticulo) ac ON ac.carticulo = ia.carticulo GROUP BY ia.carticulo;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
    OPEN cur;
        ins_loop: LOOP
            FETCH cur INTO cant,costo,articulo;
            IF done THEN
                LEAVE ins_loop;
            END IF;
            IF costo > 0 THEN
            	UPDATE inv_articulos SET cant = cant, costo_prom=costo WHERE carticulo = articulo;
            ELSE
            	UPDATE inv_articulos SET cant = cant WHERE carticulo = articulo;
            END IF;
         END LOOP;
   CLOSE cur;
END */;;
DELIMITER ;
